import React from "react";

function Contact() {
  return (
    <div>
      <h2>Contact</h2>
      <p>Feel free to contact me at:</p>
      <ul>
        <li>Email: contact@example.com</li>
        <li>Phone: 555-555-5555</li>
        <li>Address: 123 Main St, Anytown USA</li>
      </ul>
    </div>
  );
}

export default Contact;
